    <TR>
      <TD bgcolor="#ecffff">
      <P><FONT size="-1">抜群の存在感と安定のスペック！！スマートフェイス＆大容量スクエアリュックサック。しなやかでマットな上質素材を使用した、スクエアフォルムのリュックサック。シンプルな作りだからこそ、ダイレクトに伝わる使いやすさ。デザイン要素も兼ねた口折れタイプの開口部は、マグネットとファスナーの二重仕様。背面部分には、バッグ内部に直接アクセスできるファスナーを装備し、背負ったままの快適な出し入れをサポート！A4ファイルやノートも余裕で入る大きさになっています。フロントにはワイドいっぱいのファスナーポケットを装備！7inchタブレットが横向きに収納できる、使い勝手の良いサイズ感です。内側のファスナーポケットは、貴重品などを入れておくのに最適！カラーバリエーションは、シャープな印象のブラック、定番カジュアルのダークブラウン・キャメル、ミリタリーテイスト漂うカーキの全4色。</FONT></P>
      </TD>
    </TR>
    <TR>
      <TD><BR>
      </TD>
    </TR>
    <TR>
      <TD>
      <TABLE border="1">
        <TBODY>
          <TR>
            <TD><FONT size="-1">素材</FONT></TD>
            <TD><FONT size="-1">PVC(フェイクレザー)<BR>
            </FONT></TD>
          </TR>
          <TR>
            <TD><FONT size="-1">サイズ</FONT></TD>
            <TD><FONT size="-1">W35×H45(口折れ時)×D16(cm)　ショルダーベルト長さ51～97/幅4(cm)　</FONT></TD>
